					<thead>
						<tr>
							<th>名称</th>
							<th>数量</th>
							<th>类别</th>
							<th>设计单位</th>
							<th>厂商</th>
						</tr>
					</thead>
					<tbody>
						{this.getData()}
					</tbody>
				</table>
			</div>
		)
	}
}
